def test_login():
    # 3、定义测试数据
    conf_y = ConfigYaml()
    url_path = conf_y.get_conf_url()
    url = url_path+"/Login"
    # url = "https://apiuser.pacvue.com/api/Login"
    data = {"username": "yinzixin", "password": "yinzixin123"}

    request = Request()
    r = request.post(url,json=data)
    # print(r.json())
    print(r)
    # 验证
    # 返回状态码
    code = r["code"]
    # assert code == 200
    AssertUtil().assert_code(code,200)
    # 返回结果内容
    # body = json.dumps(r["body"])
    body = r["body"]
    # assert '"code": 200' in body
    AssertUtil().assert_in_body(body,'"code": 200')


